import "./Restaurant.css";
import React from "react";
import { Grid } from "@material-ui/core";
import RestaurantCard from "./RestaurantCard";
import Credits from "../Components/Credits";

const RestaurantList = (props) => {
  const restaurants = props.list;
  return (
    <div className="GridLayout">
      <div className="GridBackground">
        <img
          className="ImageBackground"
          src="https://images.unsplash.com/photo-1463797221720-6b07e6426c24?ixid=MXwxMjA3fDB8MHxzZWFyY2h8MXx8Y29mZmVlJTIwc2hvcHxlbnwwfHwwfA%3D%3D&ixlib=rb-1.2.1&w=1000&q=80"
        />
        <div className="GradientBackground" />
        <h1 className="Title">Graham's Coffee Stores</h1>
      </div>
      <div className="GridSection">
        <Grid className="GridView"  container spacing={2} direction="row" justify="center" alignItems="center">
          {restaurants.map((item) => (<RestaurantCard restaurant={item} />))}
        </Grid>
        <Credits/>
      </div>
    </div>
  );
};

export default RestaurantList;
